import styled from "styled-components";

const ButtonContainer = ({ variant, children, onClick }) => {
  const VARIANT = {
    primary: "primary",
  };

  return (
    <Styled
      onClick={onClick}
      className={`nes-btn is-${VARIANT[variant] ?? "primary"}`}
    >
      {children}
    </Styled>
  );
};

const Styled = styled.button``;

export default ButtonContainer;
